import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';
import Home from './pages/Home/Home';
import Products from './pages/Products/Products';
import Register from './pages/Register/Register';
import Login from './pages/Login/Login';
import Profile from './pages/Profile/Profile'; // Importar el componente de perfil
import ProtectedRoute from './components/ProtectedRoute'; // Importar el componente de rutas protegidas
import CategoryPage from './pages/CategoryPage/CategoryPage'; // Importar la nueva página de categoría

function App() {
    return (
        <Router>
            <div className="App">
                <Header />
                <Routes>
                    <Route path="/" element={<Home />} />
                    <Route path="/products" element={<Products />} />
                    <Route path="/register" element={<Register />} />
                    <Route path="/login" element={<Login />} />
                    {/* Ruta protegida para el perfil */}
                    <Route 
                        path="/profile" 
                        element={
                            <ProtectedRoute>
                                <Profile />
                            </ProtectedRoute>
                        } 
                    />
                    {/* Nueva ruta dinámica para las categorías */}
                    <Route path="/categories/:category" element={<CategoryPage />} />
                </Routes>
                <Footer />
            </div>
        </Router>
    );
}

export default App;
